import React from "react";
import { Layout } from "antd";

const { Content } = Layout;

const DashboardContent = ({ colorBgContainer }) => {
  return (
    <Content
      style={{
        padding: 24,
        margin: 0,
        minHeight: 280,
        background: colorBgContainer,
      }}
    >
      Content
    </Content>
  );
};

export default DashboardContent;
